import React from "react";
class Header extends React.Component {
  render() {
    return (
      <nav class="navbar">
        <div class="container">
          <h1 class="navbar-brand" href="index.html">
            Carl Leandersson
            <br />
            Portfolio
          </h1>
          <div id="filters" class="filters">
            <a href="#aboutme">About me</a>
          </div>
        </div>
      </nav>
    );
  }
}

export default Header;
